import React from 'react';


const Appointment = (props) => {
    const selectRender = () => {
        console.log("i am from Appointment", props.findLeadName)
        return props.findLeadName ? <li>{`${props.appointment.title} with ${props.findLeadName(props.appointment.lead_id)}`}</li> : <h1>{props.appointment.title}</h1>
    }
    return (
        <div className="appointment">
            {selectRender()}
         {/* <li>{`${props.appointment.title} with ${props.findLeadName(props.appointment.lead_id)}`}</li>    */}
         </div>

    )
}

export default Appointment;
